import Vue from 'vue'
import VueRouter from 'vue-router'

//安装vueRouter插件，对vue功能的扩展
Vue.use(VueRouter)

export default new VueRouter({
	routes:[
		{
			name:"SendRedPackage",
			path:"/SendRedPackage",
			component: ()=> import("./components/SendRedPackage.vue")
		},
		{
			name:"RedPackageList",
			path:"/RedPackageList",
			component: ()=> import("./components/RedPackageList.vue")
		}
	]
});
